ecord where recordid=? and deleteflg=0 and activeflg=1) \nand deleteflg=0 and activeflg=1) and deleteflg=0 and activeflg=1 ','recordid',0,1,NULL),(8,2,2,'TicketPriority','select recorddiffname as priority from recordpriority , trnrecord where recordpriority.clientid = trnrecord.clientid \n and recordpriority.mstorgnhirarchyid = trnrecord.mstorgnhirarchyid and recordpriority.recordid=trnrecord.id and trnrecord.id = ? \n and trnrecord.activeflg = 1 and trnrecord.deleteflg = 0','recordid',0,1,NULL),(9,2,2,'TicketTitle','select recordtitle from trnrecord where id=? and deleteflg=0 and activeflg=1','recordid',0,1,NULL),(10,2,2,'TicketDescription','select recorddescription from trnrecord where id=? and deleteflg=0 and activeflg=1','recordid',0,1,NULL),(11,2,2,'CustomerName','select name from mstclientuser where id in(select originaluserid from trnrecord where id=? and deleteflag = 0 and activeflag = 1) and deleteflag = 0 and activeflag = 1 ','recordid',0,1,NULL);
